import React, { Component } from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import "../css/playlistNavigation.css"
import { Navbar, Button } from "react-bootstrap";

class PlaylistNavbar extends Component {
    constructor(props) {
        super(props);
        this.state  = {
            scrollPos: window.pageYOffset,
            show: true,
        }
    }
    render () {
        return(
         <Navbar fixed="top" className="playlistNavigation">
             <a href="http://localhost:8888/login">
                <img src={require("../images/green-left-icon-arrow-left.png")} alt="Green Left Arrow" height="30"></img>
                {/* <Button className="playlist-back-button"> Back </Button> */}
             </a>
        </Navbar> 
        )
    }
}

export default PlaylistNavbar
